.modal-calendar {
  margin: 0 auto;
  width: min(320px, 94%);
  background: #fbfbfb;
  border: 1px solid #ececec;
  border-radius: 20px;

  padding-inline: 15px;
  padding-block: 10px;

  .right,
  .left {
    width: 100%;
  }

  .fromTo {
    display: flex;
    input {
      border: 1px solid #868686;
      border-radius: 20px;
      width: 100%;
      padding-left: 10px;
      padding-block: 4px;
      font-size: 12px;

      &:focus {
        border: 1px solid #086788;
        outline: none;
      }
    }

    p {
      font-size: 14px;
      padding-left: 7px;
    }
    .inp {
      position: relative;

      .plus {
        position: absolute;
        top: 50%;
        transform: translateY(-50%);
        right: 7px;
        width: 12px;
      }

      .cross {
        position: absolute;
        top: 50%;
        transform: translateY(-50%);
        right: 1px;
        width: 25px;
      }
    }
  }

  .filters {
    display: flex;
    align-items: center;
    justify-content: space-between;
    overflow-x: scroll;
    padding: 0;
    .item {
      white-space: nowrap;
      font-size: 12px;
      color: #010c10;

      padding: 5px 10px;
      border-radius: 20px;
      border: 1px solid #868686;

      &.active {
        background: #16a6d6;
        color: #fff;
        border: none;
      }
    }

    .item + .item {
      margin-left: 10px;
    }
  }

  .recent {
    border-bottom: 1px solid #ececec;
  }

  .next {
    color: #868686;
  }

  .head,
  .body {
    display: flex;
    flex-wrap: wrap;
    p {
      width: calc(100% / 7);
      line-height: 31px;
      text-align: center;
    }
  }

  .head {
    font-size: 10px;
    line-height: 12px;

    /* Серый */

    color: #868686;
  }

  .btn-groups {
    display: flex;
    column-gap: 10px;
    button {
      padding-block: 8px;
      font-size: 15px;
    }
  }

  .title {
    font-size: 14px;
    text-align: center;
  }
  .body {
    font-size: 12px;
    line-height: 15px;
    /* identical to box height */

    /* Чёрный */

    color: #010c10;

    span {
      display: block;
      width: 100%;
      height: 100%;
    }

    p.first {
      background: #ececec;
      border-radius: 15px 0 0 15px;

      span {
        background: #278808;
        border-radius: 15px;
        color: #fff;
      }
    }

    p.between {
      background: #ececec;
    }

    p.between:nth-child(7n) {
      background: #ececec;
      border-radius: 0 15px 15px 0;
    }

    p.between:nth-child(8n) {
      background: #ececec;
      border-radius: 15px 0 0 15px;
    }

    p.last {
      &:not(:nth-child(8n)) {
        background: #ececec;
        border-radius: 0 15px 15px 0;
      }
      span {
        background: #278808;
        border-radius: 15px;
        color: #fff;
      }
    }
  }
}

